import { TextField, Button, Grid } from "@mui/material";
import React from "react";

const LoginForm = () => {
  const handleSubmit = (event) => {
    event.preventDefault();

    const data = new FormData(event.currentTarget);

    const userData = {
      email: data.get("email"),
      password: data.get("password"),
    };

    console.log("userData", userData);
  };

  return (
    <form onSubmit={handleSubmit}>

      <Grid sx={{ mt: 3 }}>
        <Grid item xs={12}>
          <TextField
            required
            id="email"
            name="email"
            label="Email"
            fullWidth
            size="small"
            autoComplete="email"
          />
        </Grid>
      </Grid>

      <Grid sx={{ mt: 3 }}>
        <Grid item xs={12}>
          <TextField
            required
            id="password"
            name="password"
            label="Password"
            type="password"
            fullWidth
            size="small"
            autoComplete="new-password"
          />
        </Grid>
      </Grid>

      <Grid sx={{ mt: 2 }}>
        <Grid item xs={12}>
          <Button
            type="submit"
            variant="contained"
            fullWidth
            size="large"
            sx={{
              mt: 1,
              py: 1.2,
              fontSize: "1rem",
              backgroundColor: "#9351e4ff",
              boxShadow: 2,
            }}
          >
            LOGIN
          </Button>
        </Grid>
      </Grid>
    </form>
  );
};

export default LoginForm;
